export enum USER {
    TYPE = "TYPE",
    ENVIRONMENT = "ENVIRONMENT",
    COUNTRY = "COUNTRY",
    JOB = "JOB",
    DEAL = "DEAL",
    PASSWORD = "PASSWORD",
    BUSINESSMODEL = "BUSINESSMODEL"
}

export const DEFAULT_USER = "DEFAULT";
